from face_embeddings import *
import numpy as np



def calculate_l2_distance(emb1, emb2):
    return np.sqrt(np.sum((emb1 - emb2)**2))

def search_smallest_distance(face, faceList):

    smaller_distance = 10
    target_id = None
    for face_element in faceList: 
       dist = calculate_l2_distance(np.array(face[1]), np.array(face_element[1]))
       if dist < smaller_distance:
           smaller_distance = dist
           target_id = face_element[0]
           if dist == 0:
               break

    if target_id != None:
        print("face has been found, id:", target_id, "distance:", smaller_distance)
    else:
        print("face identify not found in list")     
    


